import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { createBusiness } from '../../services/api';

const BusinessSetup = () => {
  const [formData, setFormData] = useState({
    name: '',
    category: '',
    description: '',
    location: '',
    contactNumber: '',
    additionalInfo: ''
  });
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);

  const navigate = useNavigate();

  const { name, category, description, location, contactNumber, additionalInfo } = formData;

  const businessCategories = [
    'Retail',
    'Food & Beverage',
    'Health & Wellness',
    'Professional Services',
    'Technology',
    'Education',
    'Home Services',
    'Beauty & Personal Care',
    'Automotive',
    'Entertainment',
    'Travel & Hospitality',
    'Manufacturing',
    'Construction',
    'Real Estate',
    'Financial Services',
    'Other'
  ];

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setLoading(true);

    try {
      await createBusiness(formData);
      navigate('/dashboard');
    } catch (error) {
      setError('Failed to create business profile');
      console.error(error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="container">
      <div className="card">
        <h2>Business Setup</h2>
        <p className="subtitle">Tell us more about your business</p>

        {error && <div className="error-message">{error}</div>}

        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label htmlFor="name">Business Name</label>
            <input
              type="text"
              id="name"
              name="name"
              value={name}
              onChange={handleChange}
              required
            />
          </div>

          <div className="form-group">
            <label htmlFor="category">Business Category</label>
            <select
              id="category"
              name="category"
              value={category}
              onChange={handleChange}
              required
            >
              <option value="">Select a category</option>
              {businessCategories.map((cat) => (
                <option key={cat} value={cat}>{cat}</option>
              ))}
            </select>
          </div>

          <div className="form-group">
            <label htmlFor="description">Business Description</label>
            <textarea
              id="description"
              name="description"
              value={description}
              onChange={handleChange}
              required
              rows={3}
              placeholder="Briefly describe what your business does"
            />
          </div>

          <div className="form-group">
            <label htmlFor="location">Business Location</label>
            <input
              type="text"
              id="location"
              name="location"
              value={location}
              onChange={handleChange}
              placeholder="City, State, Country"
            />
          </div>

          <div className="form-group">
            <label htmlFor="contactNumber">Contact Number</label>
            <input
              type="text"
              id="contactNumber"
              name="contactNumber"
              value={contactNumber}
              onChange={handleChange}
              placeholder="e.g., +1 (555) 123-4567"
            />
          </div>

          <div className="form-group">
            <label htmlFor="additionalInfo">Additional Information</label>
            <textarea
              id="additionalInfo"
              name="additionalInfo"
              value={additionalInfo}
              onChange={handleChange}
              rows={5}
              placeholder="Provide any additional details about your business, such as your target audience, unique selling points, products/services, goals, etc."
            />
            <small className="form-text">
              This information will be analyzed by AI to provide better recommendations for your business.
            </small>
          </div>

          <button type="submit" className="btn btn-primary" disabled={loading}>
            {loading ? 'Creating Profile...' : 'Complete Setup'}
          </button>
        </form>
      </div>
    </div>
  );
};

export default BusinessSetup;
